import React from 'react';

export default function Product(props) {
  const { product, onAdd } = props;
  return (
    
    <div className= ' col-lg-12 col-md-9 col-md-6 col-sm-3 col-sm-1'>
      <img className="small row col-lg-12 col-md-9 col-md-6 col-sm-3 col-sm-1" src={product.image} alt={product.name} />
    
      
      <h3>{product.name}</h3>
      <div>Rs.{product.price}</div>
      
      <div>
        <button onClick={() => onAdd(product)}>Add To Cart</button>
      </div>
    </div>
  );
}
